import App from "../App";
import ImageComponent from "./ImageComponent";

function ImageList({ images }) {
    return (
        <div>
            {images.map((image) => (
                <ImageComponent key={image.id} src={image.src} alt={image.alt} />
            ))}
        </div>
    );
}

export default ImageList;
